// This creates an array with 25 items.
// Each item is just an empty object.
const items = Array(44).fill({});

// n8n will output these as 25 separate items
return items;

// Pega TODOS os itens que saíram do nó chamado "Merge1"
const mergedItems = $('Merge1').all();
console.log(`Recebido ${mergedItems.length} itens do Merge1.`);

const chatwootShortNumbers = []; // Array para guardar os números curtos (Chatwoot)
const supabaseItems = [];      // Array para guardar os itens completos do DB

// --- 1. Separar as listas ---
console.log("Separando listas Chatwoot e DB...");
let itemCount = 0; // Contador para limitar o log

for (const item of mergedItems) {
  itemCount++;
  try {
    // ----> LOG DETALHADO DOS PRIMEIROS ITENS <----
    if (itemCount <= 5) { // Loga apenas os 5 primeiros itens para não poluir
      console.log(`--- Item ${itemCount} ---`);
      console.log('Conteúdo de item.json:', JSON.stringify(item.json, null, 2)); // Mostra a estrutura exata
    }
    // ---------------------------------------------

    if (!item || !item.json) {
       console.warn('Item inválido recebido do Merge:', item);
       continue;
    }

    // Tenta ler os campos cruciais ANTES das condições
    const inputIndex = item.json.inputIndex; // <-- VERIFIQUE O NOME AQUI
    const phone = item.json.telefone;       // <-- VERIFIQUE O NOME AQUI

    // Log para verificar se os valores foram lidos
    // if (itemCount <= 5) {
    //   console.log(`Lido inputIndex: ${inputIndex}, Lido phone: ${phone}`);
    // }

    if (inputIndex === undefined) {
      if (itemCount === 1) console.warn('PRIMEIRO ITEM SEM inputIndex:', item.json); // Loga só o primeiro erro
      continue; // Pula item se não tiver o campo do Merge
    }

    if (phone === null || phone === undefined) {
      // if (itemCount <= 5) console.log(`Item ${inputIndex === 0 ? 'Chatwoot' : 'DB'} sem telefone.`);
      continue; // Pula item sem telefone
    }

    // Garante que é string e limpa não-dígitos
    const cleanedPhone = String(phone).replace(/\D/g, '');

    if (inputIndex === 0) { // Veio do Chatwoot (números curtos - sem DDD)
      if (cleanedPhone.length === 8) {
        chatwootShortNumbers.push(cleanedPhone);
      } else {
         if (itemCount <= 10) console.warn(`Número Chatwoot (idx 0) inesperado: Raw='${phone}', Cleaned='${cleanedPhone}'`);
      }
    } else if (inputIndex === 1) { // Veio do DB
      supabaseItems.push({ originalItem: item, cleanedPhone: cleanedPhone });
    } else {
       if (itemCount <= 10) console.warn(`inputIndex com valor inesperado: ${inputIndex} no item:`, item.json);
    }

  } catch (error) {
    console.error(`Erro ao processar item ${itemCount}:`, error, item);
  }
}
console.log(`Separado ${chatwootShortNumbers.length} números Chatwoot e ${supabaseItems.length} itens DB.`);

// --- O resto do código (filtragem) permanece o mesmo ---
// ... (código da filtragem a partir de 'const dbItemsSemMatch = [];') ...

const dbItemsSemMatch = [];
console.log("Filtrando itens do DB...");
for (const dbEntry of supabaseItems) {
  // ... (código interno da filtragem) ...
  const dbItem = dbEntry.originalItem;
  const longNumStr = dbEntry.cleanedPhone; // Telefone do DB já limpo
  let encontrouSubstring = false;

  try {
    for (const shortNum of chatwootShortNumbers) {
      if (longNumStr.endsWith(shortNum)) { // Ou .includes()
        encontrouSubstring = true;
        break;
      }
    }
    if (!encontrouSubstring) {
      delete dbItem.json.inputIndex;
      dbItemsSemMatch.push(dbItem);
    }
  } catch (error) {
     console.error('Erro ao filtrar item do DB:', error, dbItem);
  }
}
console.log(`Filtragem concluída. Encontrado ${dbItemsSemMatch.length} itens do DB sem correspondência.`);

return dbItemsSemMatch.map(item => ({ json: item.json }));

// Pega os números do Chatwoot (Input 1) e cria um Set para busca rápida
const numerosExistentes = new Set();

for (const item of $('Dados tratado do chatwoot sem +55 e ddd1').all()) {
  if (item.json.telefone) {
    numerosExistentes.add(item.json.telefone);
  }
}

// Filtra os números do DB2 (Input 2) que NÃO existem no Chatwoot
const numerosNovos = [];

for (const item of $('Dados DB2').all()) {
  if (item.json.telefone) {
    // Extrai apenas os últimos 8 dígitos
    const telefone8digitos = item.json.telefone.slice(-8);

    // Se NÃO existe no Chatwoot, adiciona na lista
    if (!numerosExistentes.has(telefone8digitos)) {
      numerosNovos.push(item.json);
    }
  }
}

return numerosNovos;
